import '../App.scss';
import React from 'react';
import { useState, useEffect } from "react";

function Navigation() {
    const [burgerOpen, setBurgerOpen] = useState(false) 
  return (
    <div className="navigation">
        <div className="burger_menu">
            { burgerOpen ? 
            <img src={`${process.env.PUBLIC_URL}/assets/menu-icon-open.svg`} alt="icon of a menu made out of three parrarel lines" onClick={setBurgerOpen(true)}/> : 
            <img src={`${process.env.PUBLIC_URL}/assets/menu-icon-closed.svg`} alt="icon of a menu made out of two crossed lines"  onClick={setBurgerOpen(false)} />}

        </div>
        <div className="navigation-logo-container">
            <a href="/">
            <img src={`${process.env.PUBLIC_URL}/assets/Samochodowka-logo.png`} alt="logo of the school, deep blue syluette of a car" />
            <h2>Samochod√≥wka</h2>
            <p>W Koszalinie</p>
            </a>
        </div>
        <ol>
            <li><a href="./parents">For parents</a></li>
            <li><a href="./students">For students</a></li>
            <li><a href="./recruitation">Recruitation</a></li>
            <li><a href="./about">About</a></li>
        </ol>
    </div>
  );
}

export default Navigation;
